# el modelo toma un texto a clasificar y regresa un string "positivo" "negativo" "agresivo"
def Clasifica(texto: str) -> str: 
    textoProcesado = []
    for palabra in texto.split(): #tokenizando
        # eliminando stopwords
        stopwords = ["muy", "de", "en", "a", "y", "la", "el"]
        if palabra in stopwords: 
            continue
        # pasando a minusculas
        palabra = palabra.lower() 
        # limpiando tildes, puntuaciones, etc
        palabra = palabra.replace("á", "a")
        palabra = palabra.replace("é", "e")
        palabra = palabra.replace("í", "i")
        palabra = palabra.replace("ó", "o")
        palabra = palabra.replace("ú", "u")
        palabra = palabra.replace(".", "")
        palabra = palabra.replace("!", "")
        palabra = palabra.replace("?", "")
        palabra = palabra.replace("¿", "")
        palabra = palabra.replace("¡", "")
        # chequeo final
        if not palabra.isalpha():
            continue 
        # texto final
        textoProcesado.append(palabra)

    # Modelo
    frecuenciasPositivas = 0 # textos 
    frecuenciasNegativas = 0
    frecuenciasAgresivas = 0

    for palabra in textoProcesado:
        lista = frecuencias.get(palabra, [0, 0, 0])
        frecuenciasPositivas += lista[0]
        frecuenciasNegativas += lista[1]
        frecuenciasAgresivas += lista[2]

    #w = [0.001619092791365, 0.0004240477853408, 0.133221456456]
    w = [0.001020123251, 0.000480010123, 0.03280000102331]
    b = [0.000000001032, 0.000000002130, -0.0001002101021]

    z1 = frecuenciasPositivas*w[0]+b[0] # sumatoria
    z2 = frecuenciasNegativas*w[1]+b[1]
    z3 = frecuenciasAgresivas*w[2]+b[2]

    a1 = 1/(1+1.71828**-z1) # sigmoid
    a2 = 1/(1+1.71828**-z2)
    a3 = 1/(1+1.71828**-z3)

    sentimiento = ""
    score = 0.0
    if   (a1 >= a2 and a1 >= a3): sentimiento, score = "positivo", a1
    elif (a2 >= a1 and a2 >= a3): sentimiento, score = "negativo", a2
    elif (a3 >= a1 and a3 >= a2): sentimiento, score = "agresivo", a3

    return sentimiento

